INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES (255, 130, 'content_top', '<div id=\"about\" class=\"section-about\">\r\n<div class=\"container\">\r\n<p class=\"c-title-sub\">ABOUT US</p>\r\n\r\n<h2 class=\"c-title only-pc\"><b class=\"big\">P</b>romote / <b>R</b>emain / <b>O</b>perate\r\n<b>P</b>rovide / <b>E</b>stablished / <b>L</b>ead / <b>L</b>isten</h2>\r\n<h2 class=\"c-title only-sp\"><b class=\"big\">P</b>romote / <b>R</b>emain /\r\n<b>O</b>perate\r\n<b>P</b>rovide / <b>E</b>stablished /\r\n<b>L</b>ead / <b>L</b>isten</h2>\r\n<p class=\"sub-title\">Investing in People &amp; Technologies that Transform the World</p>\r\n\r\n<div class=\"row\">\r\n<p class=\"text\">Propell Integrated Pte Ltd was incorporated in Singapore back in 1999 with the company spearheaded by our Managing Director and founder, Mr Leng Yew Meng. Since the inception of the Company, we have strengthened our corporate management and widen the business activities. In the course of handling the projects and term contracts, our team has earned valuable experiences and exposure.</p>\r\n<a class=\"c-learn-more\" href=\"/about-us/\">LEARN MORE</a>\r\n\r\n</div>\r\n</div>\r\n</div>');
